import React, { Component } from 'react';

import './MyList.css';

class MyList extends Component {
    constructor(props) {
        super(props)

        this.state = {
            myList: [ 4, 5, 6 ],
        };
    }

    function () {
        this.setState();
    }

    render() {
        return (
            <center><ol>
            {this.state.myList.map((item) => {
                return <li>{item}</li>
            })}
            </ol></center>
        )
    }
}

export default MyList
